import { API } from "../../../Backend";

export const fetchInfo = (data) => {
    return fetch(`${API}/search`, {
        method: "POST",
        headers: {
            Accept: "application/json",
            "Content-Type": "application/json",
        },
       body: JSON.stringify(data)  
    })
    .then(response => {
        return response.json()
    })
    .catch(err => console.log(err));
}
